import './App.css';
import Homepage from "./HomePage";
import {
	BrowserRouter as Router,
	Routes,
	Route,
	Link
} from 'react-router-dom';


function App() {
return (
	<>
  <Homepage/>
  <div>
	<ul>
	<li>
		<Homepage to="/">Home</Homepage>
	</li>
	<li>
		<Link to="/about">About Us</Link>
	</li>
	<li>
		<Link to="/contact">Contact Us</Link>
	</li>
	</ul>
</div>

	</>
);
}

export default App;
